import React, { useState } from 'react'
import { HiMenuAlt4,HiX } from 'react-icons/hi';
import { motion } from 'framer-motion';
import { images } from '../../constants';
import { BsTwitter, BsInstagram } from 'react-icons/bs';
import { FaFacebookF } from 'react-icons/fa';
import './Navbar.scss'

const Navbar = () => {
  const [toggle, setToggle] = useState(false)
  return (
    <nav className='app_navbar'>
      <div className='app__navbar-logo'>
        <img src= {images.logo} alt='logo'/>
      </div>
      <ul className='app__navbar-links'>
        {['home', 'about', 'work', 'skills', 'contact', 'certificates'].map((item)=>(
          
          <li className='app_flex p-text' key={`link-${item}`}>

            <a href={`#${item}`}>{item}</a>
          </li>
          
        ))}
      </ul>

      <div className='app__navbar-menu'>
            <HiMenuAlt4 onClick={()=>setToggle(true)}/>

            {toggle && (
              <motion.div
              whileInView={{ x: [300, 0] }}
              transition={{ duration: 0.85, ease: 'easeOut' }}>
                
                <HiX onClick={()=>setToggle()} />
                <ul>
                {['home', 'about', 'work', 'skills', 'contact', 'certificates', <BsTwitter />,<FaFacebookF />,<BsInstagram />].map((item)=>(
                <li key ={item}>
                <a href = {`#${item}`} onclick={() =>setToggle(false)}>{item}</a>
                </li>
                ))}
                </ul>

              </motion.div>
            )}
      </div>
    </nav>
    
  )
}

export default Navbar
